import React, { Component } from "react";
import { Table, Space } from 'antd';

class EmployeeTable extends Component {
  
  constructor(props) {
    super(props);
    this.columns = [
      {
        title: 'Name',
        dataIndex: 'name',
        key: 'name',
        render: text => <a>{text}</a>,
      },
      {
        title: 'Age',
        dataIndex: 'age',
        key: 'age',
      },
      {
        title: 'Email',
        dataIndex: 'email',
        key: 'email',
      },
      {
        title: 'Role',
        dataIndex: 'role',
        key: 'role',
      },
      {
        title: 'Action',
        key: 'action',
        render: (text, record) => (
          <Space size="middle">
            <a>Update</a>
            <a onClick={(e) => { this.onDelete(record.key,e); }}>Delete</a>
          </Space>
        ),
      },
    ];
  }

    render() {
        return(
            <Table columns={columns} dataSource={this.props.employee} />
        );
    }
}
export default EmployeeTable;
